import './App.css';
import Conjurer from './Components/Conjurer/Conjurer';
import Header from './Components/Header/Header';
import SpellSelector from './Components/SpellSelector/SpellSelector';

function App() {
  return (
    <div className="App">
      <Header></Header>
      <SpellSelector></SpellSelector>
      <Conjurer></Conjurer>
    </div>
  );
}

export default App;
